  const [name1, setName1] = useState(12);
  const setName1Handler = () => {
    setName1(13);
    console.log(name1);
  };

  if (name1 === 13) {
    return (
      <div className="new-expense">
        <NewExpense onSaveExpenseData={SaveExpenseDataHandler} />
        <button name={name1}>Add Expense</button>
      </div>
    );
  } else {
    return (
      <div className="new-expense">
        <button name={12} onClick={setName1Handler}>
          Add Expense
        </button>
      </div>
    );
  }

  const SaveExpenseDataHandler = (enteredExpenseData) => {
    const expenseData = {
      ...enteredExpenseData,
      id: Math.random().toString(),
    };
    props.onAddExpense(expenseData);
  };
};

export default NewExpense;
